==简介==
本模板能帮助您创造出不含[http://en.wikipedia.org &nbsp;]&nbsp;符号的外部连结。
== 举例 ==
*<code><nowiki>{{plain link|url=http://www.goo.com}}</nowiki></code> 给出 {{plain link|url=http://www.goo.com}}
*<code><nowiki>{{plain link|http://www.goo.com goo}}</nowiki></code> 给出 {{plain link|http://www.goo.com goo}}
*<code><nowiki>{{plain link|http://www.goo.com}}</nowiki></code> 给出 {{plain link|http://www.goo.com}}
